import Card from '../UI/Card';
import MealItem from './MealItem/MealItem';
import classes from './AvailableMeals.module.css';

const DUMMY_MEALS = [
  {
    id: 'm1',
    name: 'Paneer Tikka Pizza',
    description: 'Relish a delicious pizza with a mix of paneer,veggies and cheese in every bite..!',
    price: 20.10,
  },
  {
    id: 'm2',
    name: 'Bbq Chicken Pizza',
    description: 'A classic for a reason!Savour chunks of smoked BBQ chichken with crunchy capsicum for a wholesome treat!',
    price: 30.5,
  },
  {
    id: 'm3',
    name: 'Spanish Sunshine Pizza',
    description: 'Enjoy a colourful abundace of veggies with a genereous addition of cheese in this tasteful combination',
    price: 34.99,
  },
  {
    id: 'm4',
    name: 'Double Chicken Feast Pizza',
    description: 'Double down on the goodness of chicken, with a bunch of exotic veggies and mouth-watering cheese',
    price: 28.99,
  },
];

const AvailableMeals = () => {
  const mealsList = DUMMY_MEALS.map((meal) => (
    <MealItem
      key={meal.id}
      id={meal.id}
      name={meal.name}
      description={meal.description}
      price={meal.price}
    />
  ));

  return (
    <section className={classes.meals}>
      <Card>
        <ul>{mealsList}</ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
